import { useState } from "react";

const Prices = props => {
  const [currency, setCurrency] = useState("USD");

  const handleOnChange = e => {
    setCurrency(e.target.value.toString());
  };
  //console.log(props);
  return <div>{currency}</div>;
};

export default Prices;
